import React from 'react';
import './style.css';

export default class Search extends React.Component{
  constructor() {
    super();
    this.state = {search : ''};
  }

  handleChange = (event) => {
    const target = event.target;
    const name = target.name;
    this.setState({
      [name]: target.value
    });
  }

  render() {
    return (
      <form action="#" name="newform" method="post">
          <input type="text" name = "search" placeholder="Your Name" value={this.state.search} onChange={this.handleChange} />
           <input type="search" name="text" required placeholder="Поиск блюд и ресторанов" />
      </form>
    );
  }
}
